import React, { useState, useEffect } from 'react';
import { Box, Typography, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Divider } from '@mui/material';
import { subscribeToVendedoras } from '../services/vendedorasService';

function formatDate(date) {
  if (!date) return '';
  return new Date(date).toLocaleString('pt-BR', {
    day: '2-digit', month: '2-digit', year: '2-digit',
    hour: '2-digit', minute: '2-digit', second: '2-digit'
  });
}

const Dashboard = () => {
  const [salesData, setSalesData] = useState([]);
  const [lastUpdate, setLastUpdate] = useState(null);

  useEffect(() => {
    const unsubscribe = subscribeToVendedoras((vendedoras) => {
      setSalesData(vendedoras);
      setLastUpdate(Date.now());
    });
    return () => unsubscribe();
  }, []);

  const total = salesData.reduce((acc, v) => acc + Number(v.valor), 0);

  return (
    <Box sx={{
      minHeight: '100vh',
      bgcolor: '#181c24',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      p: 2
    }}>
      <Typography variant="h4" sx={{ color: '#fff', fontWeight: 700, mb: 1, letterSpacing: 1 }}>
        Produção por Plataforma
      </Typography>
      <Typography variant="subtitle2" sx={{ color: '#aaa', mb: 3 }}>
        Última Atualização: {formatDate(lastUpdate)}
      </Typography>
      <TableContainer component={Paper} sx={{ maxWidth: 700, background: '#232a36', borderRadius: 2 }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 18, background: '#232a36', borderBottom: '2px solid #444' }}>PLATAFORMA</TableCell>
              <TableCell align="right" sx={{ color: '#fff', fontWeight: 700, fontSize: 18, background: '#232a36', borderBottom: '2px solid #444' }}>VLR CONTRATO</TableCell>
              <TableCell align="right" sx={{ color: '#fff', fontWeight: 700, fontSize: 18, background: '#232a36', borderBottom: '2px solid #444' }}>QTD. AP's</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {salesData.map((vendedora) => (
              <TableRow key={vendedora.id}>
                <TableCell sx={{ color: '#fff', fontSize: 20, fontWeight: 500 }}>{vendedora.nome}</TableCell>
                <TableCell align="right" sx={{ color: '#ffd700', fontSize: 22, fontWeight: 700 }}>
                  R$ {Number(vendedora.valor).toLocaleString('pt-BR')}
                </TableCell>
                <TableCell align="right" sx={{ color: '#fff', fontSize: 20, fontWeight: 500 }}>
                  {vendedora.qtd || '-'}
                </TableCell>
              </TableRow>
            ))}
            <TableRow>
              <TableCell colSpan={3} sx={{ p: 0 }}><Divider sx={{ bgcolor: '#444' }} /></TableCell>
            </TableRow>
            <TableRow>
              <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20 }}>Total</TableCell>
              <TableCell align="right" sx={{ color: '#ffd700', fontWeight: 700, fontSize: 22 }}>R$ {total.toLocaleString('pt-BR')}</TableCell>
              <TableCell align="right" sx={{ color: '#fff', fontWeight: 700, fontSize: 20 }}>
                {salesData.reduce((acc, v) => acc + (Number(v.qtd) || 0), 0)}
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default Dashboard;
